node.text:
Parece que fue ayer cuando solicité el erasmus. Recuerdo que solo me gustaban dos lugares y uno de ellos era Padova, solo por el simple hecho de que era el único sitio en donde me permitían irme un año entero. No tenía ni la más mínima idea de donde quedaba en el mapa y, aún así, no me lo pensé dos veces. Quien me iba a decir que este sitio tan desconocido para mí y a unos 3657 km de casa se iba a convertir en mi hogar. 
Solo me queda agradecer el haber compartido esta experiencia con personas que ahora mismo son fundamentales en mi día a día. Gracias por dejar en mí una huella imborrable. Gracias por haberme dejado ser “yo” y conocer a Mayra en total plenitud. Gracias por haber hecho esta experiencia aún mejor, una experiencia que aún no soy capaz de describir. Gracias por los viajes, los pances, las caídas en bici (incluso las idas al hospital), las sobremesas, las noches de fiesta, las meriendas del Agostini, los aperitivi, las borracheras de Tavernello en signori, los brindis tontos, pero sobre todo, gracias por hacerme tan feliz sin yo darme cuenta. “Cuando vives todo esto, cuando lo haces tuyo, cuando cambia tu vida… es entonces cuando lo entiendes: Once Erasmus, always Erasmus.” Sin duda alguna, fue la mejor decisión de mi vida.

